// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import CoffeeList from './components/CoffeeList';
import Profile from './component/Profile'; // Import halaman profil
import Navbar from './components/Navbar';

const App = () => {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path="/" exact component={CoffeeList} />
        <Route path="/profile" component={Profile} /> {/* Tambahkan rute untuk halaman profil */}
        {/* Rute lain */}
      </Switch>
    </Router>
  );
};

export default App;
